//import React for creating components
import React from "react";
//import list icon
import listSvg from "../assets/list.svg";

const List = ({ items }) => {
  return (
    <ul className="todo__list">
      {items.map((obj) => (
        <li className="active">
          <i>
            <img src={listSvg} alt="list icon"></img>
          </i>
          <span>All Tasks</span>
        </li>
      ))}
    </ul>
  );
};

export default List;
